import React, { useState } from "react";

export default function Task({ task, name, id, tasks, setTasks, priority }) {
  function deleteTask(e) {
    setTasks((tasks) => tasks.filter((ev) => ev.id !== task.id));
  }
  return (
    <div className="taskContainer">
      <div className="priority">{priority}</div>
      <div className="taskDescription">{name}</div>
      <button className="taskDone" value={id} onClick={console.log(priority)}>
        X
      </button>
    </div>
  );
}
